import React from 'react';
import './App.scss';
import Header from "./header/Header";
import Wrapper from "./interactions/Wrapper";
import FAQ from "./navbar/FAQ";




class App extends React.Component {
    render() {

        return (
            <>
                <FAQ/>
                <Wrapper/>
                <nav>
                    <Header/>
                </nav>
                <main>
                    {this.props.children}
                </main>

            </>
        );
    }
}


export default App;
